create table gz_p2_history
(
    id                   int auto_increment
        primary key,
    dt                   date not null,
    confirm_all          int  not null,
    confirm              int  not null,
    confirm_imported     int  not null,
    confirm_local        int  not null,
    treatment_hospital   int  not null,
    noInfect             int  not null,
    noInfect_imported    int  not null,
    noInfect_local       int  not null,
    observation_hospital int  not null
);

